import openModalReducer from './openModalReducer';
import closeModalReducer from './closeModalReducer';
import updateCurrentReducer from './updateCurrentReducer';
import updateEntryReducer from './updateEntryReducer';
import updateAppointmentReducer from './updateAppointmentReducer';
import { combineReducers } from 'redux';

const rootReducer = combineReducers({
  modal_open: openModalReducer,
  modal_close: closeModalReducer,
  update_current: updateCurrentReducer,
  update_entry: updateEntryReducer,
  update_appointment: updateAppointmentReducer

});

export default rootReducer;
